const printImmutable = require('./lib/printImmutable');
const IS_MAP = '@@__IMMUTABLE_MAP__@@';
const IS_ORDERED = '@@__IMMUTABLE_ORDERED__@@';
const test = (maybeOrderedMap) => maybeOrderedMap && maybeOrderedMap[IS_MAP] && maybeOrderedMap[IS_ORDERED];
const print = (val, print, indent, opts, colors) => printImmutable(val, print, indent, opts, colors, 'OrderedMap', true);
module.exports = {
  print,
  test
};
